    // );
    return (
        <div className="find-vet-appointments-container">
            <div className="find-vet-appointments-card">
                <h2>Find Vet Appointments</h2>
                <div className="find-vet-appointments-form-group">
                    <label htmlFor="userID"><FaUser className="icon" /> Enter Your User ID:</label>
                    <input
                        type="text"
                        id="userID"
                        placeholder="Enter User ID"
                        value={userID}
                        onChange={handleInputChange}
                    />
                    <button 
                        className="find-vet-appointments-button" 
                        onClick={fetchAppointments} 
                        disabled={loading}
                    >
                        {loading ? 'Loading...' : <><FaSearch className="icon" /> Find Appointments</>}
                    </button>
                </div>

                {error && <p className="find-vet-appointments-error">{error}</p>}

                {appointments.length > 0 && (
                    <div className="find-vet-appointments">
                        <h3>Vet Appointments</h3>
                        <div className="appointments-list">
                            {appointments.map((appointment) => (
                                <div key={appointment.appointmentID} className="appointment-card">
                                    <h4><FaCalendarAlt className="icon" /> {appointment.date} ({appointment.time})</h4>
                                    <p><FaUser className="icon" /> <strong>Vet:</strong> {appointment.vetName}</p>
                                    <p><FaEnvelope className="icon" /> <strong>Email:</strong> {appointment.vetEmail}</p>
                                    <p><FaPhone className="icon" /> <strong>Phone:</strong> {appointment.vetPhone}</p>
                                    <p><FaMapMarkerAlt className="icon" /> <strong>Clinic:</strong> {appointment.clinic}</p>
                                    <p><FaNotesMedical className="icon" /> <strong>Reason:</strong> {appointment.reason}</p>
                                </div>
                            ))}
                        </div>
                    </div>
                )}
            </div>
        </div>
    );

};

export default FindVetAppointments;
